This a Full Remote job, the offer is available from: Spain

This is a remote position.

We are urgently looking for 2 Full Remote iOS Developers. Our employer is looking for a Junior and Senior iOS Developer.

Candidates need to have a good level of English or willing to improve/learn.

This position is only open for employees, who would like to work remote. Candidates need to be willing to go to the office in Murcia for 5 days on a quarterly base.

Tasks and Responsibilities:

​
• Design and develop software solutions to client requirements;
• Participate in identifying problem areas and defining solutions;
• Able to articulate problems and solutions in non-technical language to stakeholders;
• Understand interactions and dependencies between software components;
• Support the product engineering lead(s) in project set up, execution and key ceremonies including backlog refinement, sprint planning, demos and retrospectives;
• Support learning and development activities for junior product engineering resources;

Profile:
• College / university degree, Bacc. Ing. Comp (or similar);
• +3 years of mobile development experience using iOS frameworks such as Core Data, Cocoa Touch etc;
• +5 years of software development experience;
• Strong understanding of Apple’s design principles & interface guidelines;
• Experience with MVVM, MVC & Viper architecture;
• Experience with offline storage, threading and performance tuning;
• Familiar with RESTFUL APIs, cloud message APIs and notifications;
• Knowledge of RxSwift, Core Animation, Core Location;
• Experience with automated build and test;
• Familiar with GIT, Jenkins and other CI/CD development environments;
• Experience of working in scrum / sprint teams using agile ways of working including knowledge of JIRA / ADO;
• Candidates need to have a good level of English and/or willing to improve/learn;

Technologies: iOS Frameworks (Core Data, Cocoa Touch etc.), Core Animation, Core Location, MVVM, MVC, Viper, Restful API, RxSwift, Swift, UIKit

Offered:
• Attractive salary package (employees);
• Career development training;
• English classes;

Interested: Please send your resume to
resume@all-european-careers.com

This offer from "All European Careers" has been enriched by Jobgether.com and got a 72% flex score.

About our client

You probably already use their apps to calculate your numbers, wake up in the morning, check the weather, track your flight, play a game or browse your favourite videos.

Our client is a global mobile development studio that creates, publishes and maintains their own mobile applications to make people´s everyday life easier. They are a leading European-based publisher that deeply cares about its user and delivers best-in-class applications through advanced technology and unique, customizable content.

Our clients group of talented people (currently over 55 and counting) work agile and in X-functional teams. They combine all the right expertise & capabilities to stay on top of the ever-changing app market and constantly grow their portfolio of successful apps. Millions of consumers worldwide enjoy their top-ranked apps daily, and their consumer base is growing every day.

Their Development team is growing and now we are looking for a Senior IOS Developer to join us, flexible from our office in Valencia.

Senior IOS Developer:

You will join a team of innovative and creative IT professionals who invent, design, develop and release apps on multiple leading mobile platforms. You’ll report to the Head of Technology and collaborate with other Developers, Designers, R&D and QA testers in Scrum teams.

What you’ll do:

• Program new and existing native, mobile applications in Swift;
• Contribute to the optimization of the applications;
• Contribute to creating and managing the iOS Coding Guidelines;
• Share your programming skills with your colleagues in order to grow as a team;
• As a Senior iOS Developer, you will be responsible to coach junior team members.

What we’re looking for:

• Higher education or equivalent ability;
• 6+ years of work experience as iOS developer;
• Experience with Swift, Objective-C and interest in other languages such as C++ (we try not to add any new ObjC code, but there´s legacy code that our developers need to update sometimes);
• Good knowledge of the functional and design guidelines of iOS;
• Good verbal and written communication skills in English;
• Interest in mobile applications;
• Great passion for developing;
• True team player skills and ability to coach other team members;
• Experience within an Agile environment is a plus.

What we offer:

• Competitive salary (40-55k)
• Lots of training to continuously develop your skills
• Full remote work (occasional visits to the office to meet the team).
• Private Health Insurance fully paid by us
• Nice office in the city center of Valencia
• Diverse and international company culture

Company culture:

We sincerely care for each other and our work-life balance. In our work, we collaborate and challenge each other. We speak up, we give and receive feedback and we are proud of our “decide and do” mindset. And last but not least, we ensure that what we do is meaningful.
